import React, { Component } from 'react';
import SiteHeader from './components/SiteHeader';
import HomepageImage from './components/HomepageImage';
import { Link, animateScroll as scroll, Element, Events, scrollSpy, scroller } from 'react-scroll';
import Home from './components/Home';
import About from './components/About';
import Projects from './components/Projects';
import Contact from './components/Contact';
import More from './components/More';


class App extends Component {

  render() {
    return (

      <div>

        <div>
          <h1>Charlie Leopard</h1>
          <nav>
            <ul className='header'>
              <li><Link exact to="/">Home</Link></li>
              <li><Link to="/about">About me</Link></li>
              <li><Link exact to="/projects">Projects</Link></li>
              <li><Link to="/contact">Contact</Link></li>
              <li><Link exact to="/more">More</Link></li>
            </ul></nav>
        </div>

        <React.Fragment>
          <Element id='/' name='/'>
            <Home />
          </Element>
        </React.Fragment>

        <React.Fragment>
          <Element id='/about' name='/about'>
            <About />
          </Element>
        </React.Fragment>
        <React.Fragment>
          <Element id='/projects' name='/projects'>
            <Projects />
          </Element>
        </React.Fragment>
        <React.Fragment>
          <Element id='/contact' name='/contact'>
            <Contact />
          </Element>
        </React.Fragment>
        <React.Fragment>
          <Element id='/more' name='/more'>
            <More />
          </Element>
        </React.Fragment>

      </div>
    );
  }
}

export default App;
